	var itemIDs = [];
	var itemRequests = [];

	function appendCharacter(name, profession, equipment) {
		var slots = professionToSlots[profession];
		var weapons = (characterWeapons[name] || []).concat(aquaticWeapons[profession]);
		var weight = professionToWeight[profession];
		var details = document.createElement('details');
		var h1 = document.createElement('h1');
		var a = document.createElement('a');
		a.href = 'https://gw2efficiency.com/c/' + encodeURIComponent(name);
		a.textContent = name;
		h1.appendChild(a);
		h1.appendChild(document.createTextNode('\u2019s Gear'));
		var summary = document.createElement('summary');
		summary.appendChild(h1);
		details.appendChild(summary);
		var ul = document.createElement('ul');
		details.appendChild(ul);
		var anchor = document.createElement('a');
		anchor.name = name.replace(/ /g, '_') + '_remaining';
		details.appendChild(anchor);
		document.body.appendChild(details);

		var equipmentBySlot = {};

		equipment.forEach(function(e) {
			equipmentBySlot[e.slot] = e;
		});

		var anyRequests = false;
		slots.forEach(function(slot) {
			if (equipmentBySlot[slot]) {
				itemIDs.push(equipmentBySlot[slot].id);
				anyRequests = true;
			}
		});

		function done(items) {
			var haveWeapons = [];

			slots.forEach(function(slot) {
				if (equipmentBySlot[slot] && items[equipmentBySlot[slot].id] && {"Ascended": true, "Legendary": true}[items[equipmentBySlot[slot].id].rarity]) {
					var item = items[equipmentBySlot[slot].id];

					if (slot.indexOf("Weapon") === 0) {
						haveWeapons.push(item);

						var i = weapons.indexOf(item.details.type);
						if (i > -1) {
							weapons = weapons.slice(0, i).concat(weapons.slice(i + 1));
						}
					} else {
						ul.innerHTML += fromItem(item);
					}
				} else if (slot.indexOf("Weapon") !== 0) {
					var gear = gearByType[weight][slot] || gearByType["Trinket"][slot][0];
					ul.innerHTML += gear;
				}
			});
			haveWeapons.forEach(function(item) {
				ul.innerHTML += fromItem(item);
			});
			weapons.forEach(function(type) {
				var gear = weaponsByType[type];
				ul.innerHTML += gear;
			});
		}

		if (anyRequests) {
			itemRequests.push(done);
		} else {
			done({});
		}
	}

	characters.sort(function(a, b) { return new Date(a.created) - new Date(b.created); }).forEach(function(character) {
		appendCharacter(character.name, character.profession, character.equipment);
	});
	if (itemIDs.length) {
		request("items?ids=" + itemIDs.join(","), function(err, itemArray) {
			if (err) {
				throw err;
			}

			var items = {};
			itemArray.forEach(function(item) {
				items[item.id] = item;
			});

			itemRequests.forEach(function(r) {
				r(items);
			});

			init();
		});
	} else {
		init();
	}
